<script>

  var tooltip = new d3plus.Tooltip()
    .title(d => d.id);

  const bigData = [];
  for (var i = 1; i < 3000; i++) {
    bigData.push({id: i + ""});
  }

  const boxes = d3.select("svg#tester").selectAll(".box")
    .data(bigData);

  const size = 5;

  boxes.enter().append("rect")
    .attr("class", "box")
    .attr("width", size + "px")
    .attr("y", 0)
    .attr("x", (d, i) => i * size + "px")
    .on("mousemove", d => {
      const event = d3.event;
      const position = event.touches ? [event.touches[0].clientX, event.touches[0].clientY] : [event.clientX, event.clientY];
      tooltip
        .data([d])
        .position(position)
        .parent(d3.select(".testerdiv").node())
        .render();
    })
    // .on("mouseleave", () => {
    //   tooltip.data([]).render();
    // });

</script>
